import React from "react";
import { useParams } from "react-router-dom";
import { useGetProductItemQuery } from "../../redux/productsApi";
import { ErrorPage } from "../ErrorPage";

export const SkuPage = () => {
  const { id } = useParams();
  const { data, error, isLoading } = useGetProductItemQuery(id);
  const dates = data && data.data;
  return(
    <div>
      {isLoading ? (
        <p>loading...</p>
      ) : error ? (
        <ErrorPage />
      ) : (
        <div>
          <h2>{data.title}</h2>
          <img src={`http://localhost:3333${data.image}`} alt={data.title} />
          <p>{data.description}</p>
          <h3>{data.price}$</h3>
        </div>
      )}
    </div>
  )
}
